import { useState } from 'react'

export const Collapsible = ({ label, children }) => {
	const [isOpen, setIsOpen] = useState(false)
	console.log(label)

	return (
		<StyledC onClick={() => setIsOpen(!isOpen)}>
			{isOpen && { children }}
			{label}
		</StyledC>
	)
}
